webpackJsonp([0x728b5ac9bfc0],{1485:function(a,e){a.exports={data:{markdownRemark:{html:'<p>書籍を買うためにGanjiakouの本屋に行き、大きい部分がある。約20冊の本屋があり、それらのほとんどは似ていて多少異なっています。おそらく本のチャンネルは1つです。この2日間の人気のある本は、ウォレスの4冊の本と、ローレンスの4冊の本のセットです。そのすべてが小説です。私はウォレスの買うセットを選んだ。 21世紀の世界情勢についても、ブリュージンスキーの本があります。主な点は、世界は混乱状態にあり、新しい秩序はまだ形成されていないことです。小さな本、13元以上、購入していない。</p>\n<p>本のストールは活況を呈しています。多くの人々。多くの種類の本があり、テーブルにない書籍はすべてありません。ほとんどはまだまだ深刻です。社会科学の書籍は、ケンブリッジ中国史に関する書籍など、比較的大きな割合を占めていますが、これは一般的にハードカバーです。 Wushuの小説は、これなしですることはできません、これは人気のあるものです。ジン・ヨン、グ・ロングなどの有名な武術小説が一般的に有名です。それらのほとんどは、上記のウォレスとローレンスの作品や、「妻の人生」、「昼間の狩猟」、「地面の狩り」、「野生の愛」、「歪んだ人々」などの人気のある地元小説などの小説です。 "Tujie"など、私はそれが真であるか偽であるかわからない。物語を舗装するために、農村の感情的な生活のより多くの架空のまたは元の描写と混じった、地球と慣習は何ですか？最初は売れ行きが良かったし、今は冷めているようだ。さらに、人生、ヤシ、顔、風水などの書籍がたくさんあります。</p>\n<p>彼らは北京人ではないかのように、いくつかの女の子たちによって本の屋台を見下ろす。これは、市場がここで組織され、統一された方法で管理されているという事実を反映しています。これらの女の子は他の場所から北京に来て雇われ、彼らは月に200元の収入を得て、上司が世話をした。</p>\n<p>まるで上海がそのような場所を見つけなかったかのように、あまりにも多くの本屋があります。この場所は市場で、隣にはたくさんの屋台があり、衣服やその他の様々なものを販売して、宴会を楽しんでいます。書籍は、そのような大きな土地を占有することは容易ではありません。最も重要な理由は、市場を持つことです。</p>',id:"/home/swain/workspace/political-life/src/pages/ja/0133.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0133.md",frontmatter:{title:"8月13日 土曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0133.md absPath of file >>> MarkdownRemark"}}}});
